import React from "react";
import Slider from "react-slick";
import Content from '../Content'
import OGI from "../../OGI"

export default function SimpleSlider() {
  var settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slidesToShow: 5,
    slidesToScroll: 1
  };
  return (
    <Slider {...settings}>
      {OGI.map((props) => (
        <Content
          image={props.image}
       />
       ))}
    </Slider>
  );
}
